import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';
import { Fade } from 'react-awesome-reveal';
import { Link } from 'react-router-dom';
function NavBar() {
  return (
<Navbar expand="lg" className="navbar navbar-dark bg-dark" style={{zIndex: '9999' , top: '1px', width: '100%', backgroundColor: 'rgba(0, 0, 0, 0.5)', position: 'sticky' }}>
      <Container>
        <Fade left={1000} delay={1000}>
          <Navbar.Brand href="#home" className="logo">Mahmoud</Navbar.Brand>
        </Fade>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Fade top={1000} delay={1000}>
              <Nav.Link href="#home" className="active">Home</Nav.Link>
              <Link.Link href="#about">About</Link.Link>
              <Nav.Link href="#skills">Skills</Nav.Link>
              <Nav.Link href="#services">Services</Nav.Link>
              <Nav.Link href="#projects">Projects</Nav.Link>
              <Nav.Link href="#contact">Contact</Nav.Link>
            </Fade>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavBar;
